import React, { Component } from 'react';
import { Panel, Text } from 'shipnow-mercurio';
import moment from 'moment';

class AppointmentsList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            date: moment(),
        }
    }

    render() {
       return(
           <Text>{ this.state.date }</Text>
       )
    }
}

export default AppointmentsList;
